    };

    const app = firebase.initializeApp(firebaseConfig);
    const database = firebase.database(app);
    const photoContainer = document.getElementById('photoContainer');

    database.ref('photos').once('value', (snapshot) => {
      snapshot.forEach((childSnapshot) => {
        const data = childSnapshot.val();
        const key = childSnapshot.key;

        if (data.imageUrl) {
          const card = document.createElement('div');
          card.className = 'photo-card';

          card.innerHTML = `
            <img src="${data.imageUrl}" alt="Foto Pengguna">
            <p>${data.name}</p>
            <div class="like-container">
              <button class="like-btn">♥</button>
              <span class="like-count">0</span>
            </div>
            <button class="delete-btn">Hapus Foto</button>
          `;

          
          const likeBtn = card.querySelector('.like-btn');
          const likeCount = card.querySelector('.like-count');
          const likesRef = database.ref('photos/' + key + '/likes');

          
          likesRef.on('value', (snap) => {
            likeCount.textContent = snap.val() || 0;
          });

          likeBtn.addEventListener('click', () => {
            likesRef.transaction((currentLikes) => {
              return (currentLikes || 0) + 1;
            });
          });

         
          card.querySelector('.delete-btn').addEventListener('click', () => {
            const kode = prompt("Masukkan kode rahasia untuk menghapus:");
            if (kode === 'anon552') {
              database.ref('photos/' + key).remove().then(() => {
                card.remove();
                alert('Foto berhasil dihapus!');
              }).catch((error) => {
                alert('Gagal menghapus: ' + error);
              });
            } else {
              alert('Kode salah, akses ditolak!');
            }
          });

          photoContainer.appendChild(card);
        }
      });
    });
  </script>

</body>
</html>
